import{_ as t,c as d,o as r,a as e}from"./app.0525e283.js";const g=JSON.parse('{"title":"GitHub REST API 参考","description":"","frontmatter":{},"headers":[{"level":2,"title":"Design","slug":"design","link":"#design","children":[]},{"level":2,"title":"Others","slug":"others","link":"#others","children":[]},{"level":2,"title":"Names","slug":"names","link":"#names","children":[]}],"relativePath":"other/restful-api-by-github.md","lastUpdated":1673935696000}'),s={name:"other/restful-api-by-github.md"},i=e('<h1 id="github-rest-api-参考" tabindex="-1">GitHub REST API 参考 <a class="header-anchor" href="#github-rest-api-参考" aria-hidden="true">#</a></h1><blockquote><p>参考来源：<a href="https://docs.github.com/zh/enterprise-cloud@latest/rest/overview/resources-in-the-rest-api?apiVersion=2022-11-28" target="_blank" rel="noreferrer">REST API</a></p></blockquote><p>可以用来做项目架构文档的参考。 并包括了很多常见模块的说明：</p><ul><li><a href="https://docs.github.com/zh/enterprise-cloud@latest/rest/overview/resources-in-the-rest-api?apiVersion=2022-11-28#authentication" target="_blank" rel="noreferrer">身份验证</a></li><li><a href="https://docs.github.com/zh/enterprise-cloud@latest/rest/overview/resources-in-the-rest-api?apiVersion=2022-11-28#authentication" target="_blank" rel="noreferrer">速率限制</a></li><li><a href="https://docs.github.com/zh/enterprise-cloud@latest/rest/overview/api-versions?apiVersion=2022-11-28#about-api-versioning" target="_blank" rel="noreferrer">关于 API 版本控制</a></li></ul><blockquote><p>还有很多内容，最好去看原文档。</p></blockquote><h2 id="design" tabindex="-1">Design <a class="header-anchor" href="#design" aria-hidden="true">#</a></h2><p><a href="https://docs.github.com/zh/enterprise-cloud@latest/rest/overview/endpoints-available-for-github-apps?apiVersion=2022-11-28" target="_blank" rel="noreferrer">GitHub OpenAPI</a>可用于在设计自己的 REST 接口时进行参考。</p><p>例如用户相关操作：</p><ul><li>获取用户订阅列表：<code>GET /users/{username}/subscriptions</code></li><li>获取用户收藏列表：<code>GET /users/{username}/starred</code></li><li>某组织（org）的黑名单内用户（被阻止的用户）：<code>GET /orgs/{org}/blocks</code></li><li>用户所加入的组织：<code>GET /users/{username}/orgs</code></li><li>创建一个项目：<code>POST /user/projects</code></li></ul><p>更多请参考<a href="https://docs.github.com/zh/enterprise-cloud@latest/rest/overview/endpoints-available-for-github-apps?apiVersion=2022-11-28" target="_blank" rel="noreferrer">GitHub OpenAPI</a>列出的接口。</p><p>可以看出其设计语义化来接口，操作主题在前，操作在中间，被操作者在最后。 并且疑似存在类似上下级结构关系，不同主体有着不同的上下级结构。 例如用户与项目，用户为主体时表现为用户加入的项目，项目为主体时表现为项目下的成员。</p><p>另外，其主体均使用了<strong>复数形式</strong>进行表示。有些特定的修饰词也可以作为路由的一部分，例如<code>/branches</code>为分支列表，<code>/branches/protected</code>表示“受保护的分支列表”。</p><h2 id="others" tabindex="-1">Others <a class="header-anchor" href="#others" aria-hidden="true">#</a></h2><ol><li>在翻阅这些API列表时，找到一个<code>GET /repos/{owner}/{repo}/codespaces/new</code>的API，其作用为「获取用户使用存储库创建的代码空间的默认属性」。也就是说，GitHub 设计了一个提供给前端界面<code>创建代码空间</code>使用的接口，其包含了该界面（或者说<strong>代码空间</strong>这个主体）用到的所有默认属性及其默认值。</li><li><a href="https://docs.github.com/zh/enterprise-cloud@latest/rest/reference/gists#check-if-a-gist-is-starred" target="_blank" rel="noreferrer"><code>GET /gists/{gist_id}/star</code></a>在 GitHub 里表示获取该主体是否被当前登录用户 star，而利用<a href="https://docs.github.com/zh/enterprise-cloud@latest/rest/reference/gists#star-a-gist" target="_blank" rel="noreferrer"><code>PUT /gists/{gist_id}/star</code></a>来对主体进行 star 操作，DELETE 方法则是取消 star</li></ol><h2 id="names" tabindex="-1">Names <a class="header-anchor" href="#names" aria-hidden="true">#</a></h2><p>以下是一些从中吸纳的主体名称列表：</p><table><thead><tr><th>Resource</th><th>Comment</th><th>Description</th></tr></thead><tbody><tr><td>users</td><td>用户</td><td></td></tr><tr><td>orgs / organizations</td><td>组织</td><td></td></tr><tr><td>permissions</td><td>权限</td><td></td></tr><tr><td>groups</td><td>群组</td><td></td></tr><tr><td>downloads</td><td>可下载文件</td><td></td></tr><tr><td>secrets</td><td>密钥</td><td></td></tr><tr><td>variables</td><td>变量</td><td></td></tr><tr><td>owner</td><td>拥有者</td><td></td></tr><tr><td>caches</td><td>缓存</td><td></td></tr><tr><td>repositories / repos</td><td>仓库/仓储</td><td></td></tr><tr><td>environments</td><td>环境</td><td></td></tr><tr><td>workflows</td><td>工作流</td><td></td></tr><tr><td>jobs</td><td>作业，流程作业</td><td></td></tr><tr><td>events</td><td>事件</td><td></td></tr><tr><td>feeds</td><td>源摘要</td><td></td></tr><tr><td>subscribers</td><td>订阅人</td><td></td></tr><tr><td>starred</td><td>已收藏</td><td></td></tr><tr><td>installations</td><td>安装</td><td></td></tr><tr><td>app</td><td>应用</td><td></td></tr><tr><td>billing</td><td>账单，计费</td><td></td></tr><tr><td>branches</td><td>分支</td><td></td></tr><tr><td>teams</td><td>团队</td><td></td></tr><tr><td>alerts</td><td>警告/警报</td><td></td></tr><tr><td>instances</td><td>实例</td><td></td></tr><tr><td>analyses</td><td>分析</td><td></td></tr><tr><td>databases</td><td>数据库</td><td></td></tr><tr><td>languages</td><td>语言</td><td></td></tr><tr><td>collaborators</td><td>协作者</td><td></td></tr><tr><td>invitations</td><td>邀请</td><td>在GitHub这里，表现为“可邀请的xxx”，xxx由 invitations 前的主体决定。<br>例如：<code>/repos/{owner}/{repo}/invitations</code>为「所有当前打开的存储库邀请」</td></tr><tr><td>comments</td><td>注释，评论</td><td></td></tr><tr><td>statuses</td><td>状态</td><td></td></tr><tr><td>snapshots</td><td>快照</td><td></td></tr><tr><td>keys</td><td>密钥</td><td></td></tr><tr><td>deployments</td><td>部署</td><td></td></tr><tr><td>policies</td><td>策略</td><td></td></tr><tr><td>emojis</td><td>Emoji</td><td></td></tr><tr><td>blobs</td><td>二进制大对象</td><td>Git Blob（二进制大对象）是用于将每个文件的内容存储在仓库中的对象类型，文件的 SHA-1 哈希在 Blob 对象中计算和存储。</td></tr><tr><td>tags</td><td>标记</td><td></td></tr><tr><td>refs</td><td>引用</td><td></td></tr><tr><td>templates</td><td>模板</td><td></td></tr><tr><td>interactions</td><td>交互</td><td></td></tr><tr><td>assignees</td><td>代理人</td><td>类似管理员</td></tr><tr><td>contributors</td><td>建设者</td><td>有贡献的人</td></tr><tr><td>collaborators</td><td>合作者</td><td></td></tr><tr><td>authors</td><td>作者</td><td></td></tr><tr><td>issues</td><td>问题、议题</td><td></td></tr><tr><td>labels</td><td>标签</td><td></td></tr><tr><td>milestones</td><td>里程碑</td><td></td></tr><tr><td>licenses</td><td>许可证</td><td></td></tr><tr><td>versions</td><td>版本</td><td></td></tr><tr><td>meta</td><td>元数据</td><td></td></tr><tr><td>profile</td><td>配置文件，资料</td><td></td></tr><tr><td>metrics</td><td>指标</td><td></td></tr><tr><td>traffic</td><td>趋势</td><td>一般指24小时、一周内、14天内某统计指标的变化趋势</td></tr><tr><td>stats</td><td>统计信息</td><td></td></tr><tr><td>views</td><td>浏览、访问</td><td></td></tr><tr><td>blocks</td><td>被阻止的人，黑名单，无权限的人</td><td></td></tr><tr><td>members</td><td>成员</td><td></td></tr><tr><td>membership</td><td>成员资格、成员状态</td><td></td></tr><tr><td>reviews</td><td>审查</td><td></td></tr><tr><td>dismissals</td><td>驳回</td><td></td></tr><tr><td>discussions</td><td>讨论</td><td></td></tr><tr><td>assets</td><td>资源，资产</td><td></td></tr><tr><td>releases</td><td>发行，发布</td><td></td></tr><tr><td>dispatches</td><td>事件分发</td><td></td></tr><tr><td>forks</td><td>分叉</td><td></td></tr><tr><td>topics</td><td>主题</td><td></td></tr><tr><td>followers</td><td>粉丝</td><td></td></tr><tr><td>following</td><td>正在关注的人</td><td></td></tr><tr><td>attempts</td><td>重试</td><td></td></tr><tr><td>usage</td><td>使用情况</td><td></td></tr><tr><td>logs</td><td>日志</td><td></td></tr><tr><td>runners</td><td>运行器</td><td></td></tr><tr><td>stargazers</td><td>观星者，对当前主体标星的人</td><td></td></tr><tr><td>notifications</td><td>通知</td><td></td></tr><tr><td>packages</td><td>包，库</td><td></td></tr><tr><td>marketplace</td><td>应用市场</td><td></td></tr><tr><td>deliveries</td><td>交付</td><td></td></tr></tbody></table>',17),a=[i];function o(n,l,c,h,p,u){return r(),d("div",null,a)}const m=t(s,[["render",o]]);export{g as __pageData,m as default};
